import React from "react";

export default function Test4({ fruits }) {
    const check = function() {
        return fruits.map(function(fruit, index) {
            return (
                <h1 key={index}>{fruit}</h1>
            );
        });
    };

    return (
        <>
            {check()}
        </>
    );
}
